import Link from 'next/link';
import TypingCustom from '../components/TypingCustom'

const Index = () => (
    <div className='outestdiv'>
        <div className='outerdiv'>
            <div className='titlelogo'>
                <Link href='/'>
                    <a>slern.io</a>
                </Link>
            </div>
            <div className='signin'>
                <button>
                    <Link href='/login'>
                        <a>Sign In</a>
                    </Link>
                </button>
            </div>
        </div>
        <div className='tagline'>
            <TypingCustom title='By CS Students, For CS Students.' delay='300' />
        </div>


        <style jsx>{`

        .outestdiv {
            background: rgb(184,184,233);
            background: linear-gradient(180deg, rgba(184,184,233,1) 0%, rgba(0,212,255,1) 100%);

        }
        .tagline {
            text-align: center;
            padding-bottm: 50px;
        }

        .outerdiv {
            width: 100%;
            height: 180px;
            display: grid;
            font-family: Arial; 
            grid-template-columns: 95% 5%;
            font-size: 20px;

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-left: 5px;
            margin-top: 5px;
        }
        .signin {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-top: 5px;
            font-size: 20px;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }
          body {
            margin:0;
            padding:0;
          }

        `}</style>
    </div>
);

export default Index;
